                function newMarker(e){
                    var new_mark = L.marker().setLatLng(e.latlng).addTo(map_aaaca6abd1c2c3e4706db7986c1121e4);
                    new_mark.dragging.enable();
                    new_mark.on('dblclick', function(e){ map_aaaca6abd1c2c3e4706db7986c1121e4.removeLayer(e.target)})
                    var lat = e.latlng.lat.toFixed(4),
                       lng = e.latlng.lng.toFixed(4);
                    new_mark.bindPopup("Latitude: " + lat + "<br>Longitude: " + lng );
                    };
